import React, { Component } from "react";
import MedicineDataService from "../services/medicine.service";

export default class AddMedicine extends Component {
  constructor(props) {
    super(props);
  }

  onChangeName(e) {
    this.setState({
      name: e.target.value,
    });
  }
}
